import React, { useState, useEffect } from 'react';
import { useDispatch } from 'react-redux';
import {
    Modal,
    ModalHeader,
    ModalBody,
    ModalFooter,
    Form,
    FormGroup,
    FormFeedback,
    Label,
    Input,
    Button
} from 'reactstrap';

const WorkOrderCard = props => {
    return (
        <div>
            <Modal isOpen={props.isOpen}>
                <ModalHeader></ModalHeader>
                <ModalBody>
                    <Form>
                        <h1>{props}</h1>
                    </Form>
                </ModalBody>
            </Modal>
        </div>
    );
};

export default WorkOrderCard;
